import React from "react";
import './Popular.css'
import data_product from '../Assets/data'


function Popular() {
  return (
    <div className="popular" >
    <h1>POPULAR IN WOMEN</h1>
    <hr />
    <div className="popular-item">
        {data_product.map((tem,i)=>{
            return <tem key={i} id={item.id} name={item.name} image={item.image} new_price={item.new_price} old_price={item.old_price} />
        })}
    </div>   
    </div>
  );
}

export default Popular;
